import React from 'react'

export default function Activity({activity}) {

  return (
    <div className='box'>
        <div><strong>Activity</strong>:{' '} {activity.map(e =>e.name)}</div>
        <div><strong>Difficulty</strong>:{' '} {activity.map(e=>e.difficulty)}</div>
        <div><strong>Season</strong>:{' '} {activity.map(e=>e.season)}</div>
        <div><strong>Duration</strong>:{' '} {activity.map(e=>e.duration)} {' '} days</div>
    </div>
  )
}
